# encoding: utf-8
#
# 码表根据徐国银提供的《徐码全集码表（+词）》和《徐码高频先GB18030》
# (2019.08.09) 整合修订而成。
# 官方网址：www.chinput.com/xuma
#
# 码表去重 by Q
# 不定期合并编码修订。
# 还调整了一些简码，在注释中以 qmod:* 标出。
#
# 权重信息取自 Rime 郑码方案 rime/rime-zhengma 词典，由 Q 添加
# https://github.com/lotem/rime-zhengma
# 该权重不完全合理，如 iov 的顺序是「杏束」。且为实现以下目标，现已不按权重排
# 序（sort: original），该权重仅作参考和调试之用。

# 排序目标之一：保证重码时首选永远是单字，简码词组为次选和三选。
# 《徐码全集码表（+词）》的排序满足这点，定义排序方式为 original 即可。

# 排序目标之二：保证全码词组在单字之后。
# 目前通过调整全码词组区的位置实现了这点。置于所有单字之后，所有符号之前。

# 排序目标之三：保证使重码字中的简码字优先。
# 先把简码识别和分离出来，再把全码字按权重排序，同时要保证没有权重为空或相等
# 的重码字不改变顺序，因为简单重排的话，它们会颠倒过来。（现已将 GB18030 区单
# 列并另行排序，剩下的字权重几乎都为零或空，重新排序的意义不大。）

# GB18030 区单列，取自《徐码高频先GB18030》。据观察其中前 12041 字的排序取自
# 《笪骏现代汉语单字频率列表》。该字频也不完全合理，如 fbu 的顺序是「韦扫」，
# 故在前面放置一个 GB2312 区，按《6763字频表（基数10亿）》顺序排列，该区排序
# 优先生效。

---
name: "xuma"
version: "2020.01.08"
sort: original
import_tables:
  - xuma.extended
columns:
  - text
  - code
  - weight
  - stem
encoder:
  exclude_patterns:
    - '^[a-z]$'  # 一简不参与造词
    - '^bg(zs|zx|ys|yx|jc|hx|sx)$'  # 表格
    - '^sz[lyeswlqbj]'  # 数字
    # - '^dl..$'  # 特殊字符和八卦名 "乾兑坎坤巽离艮震" 的符号编码（dl?g）.
      # 误伤太多，取消这条。
  rules:
    - length_equal: 2
      formula: "AaAbBaBb"
    - length_equal: 3
      formula: "AaBaCaCb"
    - length_in_range: [4, 10]
      formula: "AaBaCaZa"
...

